import React, {useState} from 'react'
import styled from 'styled-components'
import {motion} from 'framer-motion'
const H = styled.h1`
font-size: 3rem;
font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;

text-align: center;

span{
color:blue;
}
`

const Container = styled.div`
background-color:rgb(252 255 214);
height:88vh;
display:flex;
justify-content:center;
align-items: center;
button{
width: 120px;
margin:2%;
height:60Px;
cursor:pointer;
border:none;
background-color: rgb(247, 245, 150);
color:blue;
font-size:1rem;
}
`
const Main = styled.div`

background-color:rgb(254 255 240);
`


const HH = styled.div`
font-size: 3rem;
text-align: center;
  color:blue;
font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;

` 
function Test(){
    const [toplogin , settoplogin] = useState(false);
    const [topregister , settopregister] = useState(false);
    console.log(toplogin);

    return(
        <>
        <Main>
            <Container>
               <button onClick={()=> settoplogin(!toplogin)}>Login</button>
               <button onClick={()=> settopregister(!topregister)}>Register</button>
            </Container>
        </Main>
        
         </>
    )
}

export default Test
